html,
body,
#app,
main {
  width: 100%;
  height: 100%;
  margin: 0;
  padding: 0;
  overflow: hidden;
}
html,
dt,
dd,
label,
button {
  font-family: "Segoe UI", sans-serif;
  line-height: 1.5;
  color: var(--font-color-base);
}
.icon .light-lightblue,
.icon .light-lightblue-10 {
  fill: var(--color-primary-500);
}
.dock {
  height: 100%;
}
.dock .tab {
  width: 20rem;
  height: 100%;
  background-color: var(--color-surface-50);
  border: 1px solid var(--color-surface-100);
  border-right: 0px;
}
.dock .tab-list {
  background-color: var(--color-surface-50);
  border: 1px solid var(--color-surface-100);
}
.dock .tab-item {
  padding: 0.5rem;
  width: 4rem;
  font-size: 0.6rem;
  background-color: var(--color-surface-50);
  border-bottom: 1px solid var(--color-surface-100);
}
.dock .tab-item:hover {
  background-color: var(--color-surface-100);
}
.dock .tab-item.active {
  border-right: 0.3rem solid var(--color-primary-500);
}
.dock .tab-item .icon {
  width: 2.5rem;
}
.dock .tab-item .icon svg {
  width: 100%;
  height: 100%;
}
.panel .panel-header {
  border-bottom: 1px solid var(--color-surface-100);
  font-weight: lighter;
  text-transform: uppercase;
  padding: 0.5rem 1rem;
}
.panel .indent {
  padding: 0.5rem 1rem;
}
.subpanel .subpanel-header {
  border-bottom: 1px solid var(--color-surface-100);
  font-weight: bold;
  padding: 0.5rem 1rem;
}
.subpanel .indent {
  padding: 0.5rem 1rem;
}
.panel-body input[type=checkbox],
.subpanel-body input[type=checkbox] {
  appearance: checkbox;
}
.panel-body label,
.subpanel-body label {
  font-size: 1rem;
}
.panel-body label .icon,
.subpanel-body label .icon {
  width: 1rem;
  display: inline-block;
  vertical-align: middle;
}
.panel-body button,
.subpanel-body button {
  background-color: var(--color-primary-500);
  color: var(--on-primary);
  padding: 0.25rem 0.5rem;
}
.panel-body button:hover,
.subpanel-body button:hover {
  background-color: var(--color-primary-600);
}
.diagram {
  background-color: var(--color-surface-45);
  font-family: var(--font-family-monospace);
}
